import React from 'react';
import './dizainoDarbai.css';

const dizainoDarbai = () => {
  const designs = [
    { id: 1, imgSrc: 'image1.jpg', alt: 'Design 1' },
    { id: 2, imgSrc: 'image2.jpg', alt: 'Design 2' },
    { id: 3, imgSrc: 'image3.jpg', alt: 'Design 3' },
  ];

  return (
    <div className="dizaino-darbai-container">
      <h1>Grafinio dizaino darbai</h1>
      <div className="image-row">
        {designs.map((design) => (
          <div className="image-card" key={design.id}>
            <img src={design.imgSrc} alt={design.alt} />
          </div>
        ))}
      </div>
    </div>
  );
};

export default dizainoDarbai;
